import Review from './review';


require('./styles.css')

const Reviews = () => {

  const reviewsCollection = [
    { stars: 5, servicio: "Corte de pelo", name: "Matías Borrazás", created_date: "Nov. 17, 2023", review: "Tremendo corte", answer: "Gracias Mati", answer_date: "Nov. 20, 2023" }
  ];


  return (
    <div className="reviews">
      <h3>Reseñas</h3>
      {reviewsCollection.map((review) => (
        <Review />
      ))}
    </div>
  );
}

export default Reviews;
